const sumAll = function (numA, numB) {

    let result = 0
if (numA > numB) {
    for (let i = numB; i <= numA; i++) {

        result += i ;
    }
}else {
    for (let i = numA; i <= numB; i++) {

        result += i ;

    }}

    return result
};

// Do not edit below this line
module.exports = sumAll;
